values:
Well.. The weekend was as boring as expected. First the 4 hour car trip to her house confined as close as humanly possible to my family. (No it was not enjoyable.) When we FINALLY arrived, I realized that they were short one bed. o.o; Guess who got to sleep on the floor. o.o; Jagged, concrete floor. No, Not enjoyable. x.o;

The next day, I was dragged to a "beach." It was more packed than the Jersey shore which I thought unhumanly possible, but I suppose I was wrong because this one was like.. Eating somebody else's elbows in 10909 degree weather. Fun. There was ONE highlight to it. I don't know if this is customary in New York as it is in Switzerland, but while staring out into the lake with a bored look on my eyes a bunch of young guys ran up to the water in their clothes. They stripped completely naked in front of everybody and lingered around a little ( I think one knew I was looking. o.o; ) before jumping into the water. Wow. o.o; But uhh.. They came back out and that one who I think knew I was looking was the only one who stayed... But I won't go into details about that one. o.o; Yeah, later on that night I told everybody that I was going for a nice "walk in the country".. And I hightailed it over to Cooperstown where Cryssy's club was to surprise her and such. It took some twisting and some bothering a bouncer but he let me in under "family conditions". Anyway, Crystal sang and didn't know I was there and all. She sings nice. =) But uhh.. After that was the funny part. I went backstage surprised the shit out of her and then went to sitting on the backstage bench and hitting on all of the dancers, because, they were... HOT.. <3.<3; And lmao.. Here was the funny part... Crystal went out to get something from her car on the crowded main street.. She had dug in her purse for a while because I'd taken her first set of keys to confuse her, not knowing she had an extra set. So she unlocked her car with the button and right after that, I hit the lock button on the set I had. She kept unlocking it and then I would lock it. She finally looked up and glared at me and then I snickered and hit the panic button so her car alarm would go off. Needless to say, people stopped and stared at her like she was a retard. When I finally let her get the car door open, I set off the alarm again. Funny. e.e; I got smacked too. But yeah. I didn't get to linger and chat much longer because I had to hightail it  home. I don't think any of them had a clue. Cool.

And today. Another ride in the car. Yay. The real thing that bothers me lately though occurred before we left, after my last journal entry. When my  parents argue, the whole neighborhood knows, for my mother is LOUD. So when I heard her say, "In our Family" and "junkie" in the same sentence, I got suspicious and decided to hang around the bottom of the steps to get a better view of what was going on. In doing so, I found out that my own uncle.. A man who has been with me since my birth and who I've always trusted since as far as I can remember does drugs habitually.. It's the reason for his financial trouble.. I mean.. I could have never suspected somebody so close to me guilty of the one thing that I could end my relationship with somebody for.. But.. In this case how can I even let him know my anger? I can't not talk to him, because I suppose he has no clue that I know.. But I can never look at him the same way.. bring myself to look up to him anymore... It's a sad world I live in.. When I can't even trust my family members to be clean anymore..
